webpackJsonp([69599710739010],{492:function(e,t){e.exports={data:{markdownRemark:{html:'<p>This years Google Summer of Code is drawing to a close, I’ve finalised all the functionality of my project and now it’s crossing fingers that I don’t hear back about any bugs.</p>\n<p>This week coming I’ll be providing my final evaluation and by next week it will all be over.</p>\n<p>It’s been a fun journey, having learnt so much along the way that I now consider myself a  more accomplished programmer, but of course at the same time I’ve learnt a lot about how I can improve for next time!</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 213px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 140.84507042253523%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="pandroid"\n        title=""\n        src="/static/pandroid-v3.0-97f4e5ff2240f9574ffe987e5cf6503c-af99f.png"\n        srcset="/static/pandroid-v3.0-97f4e5ff2240f9574ffe987e5cf6503c-a20d6.png 148w,\n/static/pandroid-v3.0-97f4e5ff2240f9574ffe987e5cf6503c-af99f.png 213w"\n        sizes="(max-width: 213px) 100vw, 213px"\n      />\n    </span>\n  </span>\n  </p>\n<p>You can try out my app right now by grabbing the pandroid apk file from <a href="https://dl.dropboxusercontent.com/u/17033926/partiallogic/Pandroid%20Agent%20v3.0.apk">here</a> and if you notice anything you don’t like, please <a href="http://twitter.com/_markholland">let me know!</a></p>\n<p>And of course a huge shout out to <a href="http://twitter.com/slerena">Sancho Lerena</a>, <a href="http://www.noparar.com/">Sergio Martin Zarzuelo</a> and everyone else at <a href="http://www.pandorafms.com/">PandoraFMS</a> for giving me the opportunity to work with them.</p>',frontmatter:{date:"August 19, 2012",path:"/drawing-to-a-close-gsoc.html",tags:["tag"],title:"Drawing to a close",image:{childImageSharp:{resize:{src:"/static/balloons-4e9a95cf7025f7dc1da351e45e9f97b3-57c0c.jpg"}}}}}},pathContext:{prev:{excerpt:"From SourceForge blogs:  August 13th was the the “soft pencils down” date for the Google Summer of Code, with a hard end date of August 24th. So I contacted the SourceForge projects that were involved, to see how their summer went. Some of them are…",html:'<p>From SourceForge blogs:</p>\n<p> August 13th was the the “soft pencils down” date for the Google Summer of Code, with a hard end date of August 24th. So I contacted the SourceForge projects that were involved, to see how their summer went.</p>\n<p>Some of them are still hard at it, and expect to go all the way up to the hard end date, but a few were ready to talk about how great their summer was.</p>\n<p>I heard from Sancho Lerena of the Pandora FMS project, who told me that the summer went very well.</p>\n<ul>\n<li>\n<p>Give us an overview of what your project is.</p>\n<p>Pandora FMS is an all-purpose monitoring system, but very oriented to big sites ( > 1000 nodes). It’s very very flexible and able to get information from almost any kind of source, and produce useful reports, alerts, graphs, etc.</p>\n</li>\n<li>\n<p>What was your student’s assignment?</p>\n<p>We try to use the student time in small and isolated tasks, or subprojects. We have three students and put each of them in different tasks, so they get interaction only with other developers in the project. They have been evolving a event viewer for Android and the Android agent, adding some features and increasing the usability and stability. Our other student has developed (from scratch) a Chrome and Firefox extension to show monitoring events by using our Web API.</p>\n</li>\n<li>\n<p>Was the assignment completed to your satisfaction?</p>\n<p>VERY satisfied.</p>\n</li>\n<li>\n<p>When can we expect to see the fruits of the summer’s work in a released version?</p>\n<p>Of course, all of three subjects has been produced useful code and will be used for next version, probably even before, because all of them are using interfaces and/or API compatible with current version, so, in a few weeks probably we’ll release something. All of this time they have been working with our SVN server, on Sourceforge, of course </p>\n</li>\n<li>\n<p>Would you participate in GSoC again?</p>\n<p>Will be a pleasure.</p>\n</li>\n<li>\n<p>What advice can you give to a project interested in GSoC for next year?</p>\n<p>Try to locate small parts of the project, something which don’t require learning a full API, a full architecture or Database design. Do a “roadmap” based on isolated subtasks, so if you there are any delays, you can remove some points, but have something functional at the end. If you plan five subtasks, but at the end you get only three, but these three are OK – you’ve got something to evolve and do more things in the future.</p>\n<p>We had good luck, and two of the students (one from Spain, and other from UK) were near our main office, so we organized a small meeting at the beginning, That was useful to meet people and talk about what we all expected – much better than an IRC Meeting. With the other student, from Singapore, gtalk was the best tool to keep updated on progress and give tips.\n</p>\n</li>\n</ul>\n<p><a href="http://sourceforge.net/blog/pandora-fms-and-gsoc/">Source</a></p>',id:"/home/circleci/repo/posts/2012-08-21-pandorafms-and-gsoc/index.md absPath of file >>> MarkdownRemark",timeToRead:2,frontmatter:{date:"2012-08-21T12:00:00+00:00",path:"/pandora-fms-gsoc.html",tags:["tag"],title:"PandoraFMS and GSoC"}},next:{excerpt:"Mid term evaluation is coming up soon so working hard at cleaning up code as I can be quite messy while trying to get things to work. Also was starting to realise that alot of the modules I’ve been adding are sim card dependent so I’ve added seperate…",html:'<p>Mid term evaluation is coming up soon so working hard at cleaning up code as I can be quite messy while trying to get things to work. Also was starting to realise that alot of the modules I’ve been adding are sim card dependent so I’ve added seperate views depending on whether the device has a sim card or not.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 580px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 82.41379310344827%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Screenshots"\n        title=""\n        src="/static/screenshot-views-pandroid-7e473e73170547593b12477a9835a1d8-7ee4f.png"\n        srcset="/static/screenshot-views-pandroid-7e473e73170547593b12477a9835a1d8-785d5.png 148w,\n/static/screenshot-views-pandroid-7e473e73170547593b12477a9835a1d8-2f066.png 295w,\n/static/screenshot-views-pandroid-7e473e73170547593b12477a9835a1d8-7ee4f.png 580w"\n        sizes="(max-width: 580px) 100vw, 580px"\n      />\n    </span>\n  </span>\n  </p>',id:"/home/circleci/repo/posts/2012-06-29-quick-update/index.md absPath of file >>> MarkdownRemark",timeToRead:1,frontmatter:{date:"2012-06-29T12:00:00+00:00",path:"/quick-update-gsoc.html",tags:["tag"],title:"Quick update"}}}}}});
